INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("春咲 ひより", "お！\nあそこに困ってそうな人発見！", 2, 0, 0, 0, 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("草野 優衣", "大切な人を\n守れるようになりたい…って", 2, 0, 0, 0, 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("士条 怜", "キミに必要な集中力と感性が", 2, 0, 0, 0, 0, 1003, "少しは磨かれると思いますよ。", 0, "フェンシングを始めてみては？", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("穂高 みそぎ", "今日はなにして遊ぶ？", 2, 0, 0, 0, 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "ねぇ、にいちゃん！", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("風宮 あかり", "ねぇ…", 2, 0, 0, 0, 0, 1006, "私といっしょに…\nいかない？", 0, "風宮あかりです", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("出雲 宮子", "プリンたべたいのー", 2, 0, 0, 0, 0, 1007, "食べ物の恨みは怖いのー", 0, "出雲宮子なのー", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, 0, 0, 0, 1008, "いいよ。\n見られることは運命さ…", 0, "ボクは虹村雪。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, 0, 0, 0, 1009, "人呼んで「疾風の冥姫」!!", 0, "フッ…聞いて後悔するがいい！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, 0, 0, 0, 1010, "ほんまおおきにやわ～♪", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, 0, 0, 0, 1011, "ここで会ったが\n100年目～！", 0, "衣之咲璃乃です！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("柏崎 初音", "ち、超能力って…\n何のことかな～？", 2, 0, 0, 0, 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("美波 鈴奈", "一応カリスマ読モJKやってまっす！", 2, 0, 0, 0, 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "ちょす！\n美波鈴奈だよ～♪", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("喜屋武 香織", "東京は遊園地みたいなところさー", 2, 0, 0, 0, 0, 1017, "でも、沖縄もとってもいいとこさー", 0, "はいたーい。\n喜屋武香織さー。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 2, 0, 0, 0, 0, 1018, "イオちゃんって呼んでね。", 0, "支倉伊緒です。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, 0, 0, 0, 1020, "ミミをおいてかないでぇ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("栗林 くるみ", "あの……\nふぇ……", 2, 0, 0, 0, 0, 1021, "ふぇぇぇぇぇん……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("風宮 より", "こんな私に貴重な時間を\n割いていただき、", 2, 0, 0, 0, 0, 1022, "なんてありがとうございます！", 0, "風宮よりです。\nあああああ！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("北条 綾音", "おにいちゃんどこいくの？\nえ？", 2, 0, 0, 0, 0, 1023, "私こっち行きたいー\nね、早く早くー", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, 0, 0, 0, 1025, "これて何か違う…\nあああすみません！", 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("倉石 恵理子", "あなたは…運命の……\n伴侶……", 2, 0, 0, 0, 0, 1027, "離しませんわ………\n絶対に…!!", 0, "……クスクス…私は\n…倉石恵理子……", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, 0, 0, 0, 1028, "…そうでしょ？？", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, 0, 0, 0, 1029, "あはは、\n私もまだまだだなぁ～", 0, "桜井望だよ！\nよろしくねっ", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, 0, 0, 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "デケデケデンっ！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, 0, 0, 0, 1031, "おかしいですね……", 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("野戸まひる", "けんども\nそれには足りないモンが…", 2, 0, 0, 0, 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("綾瀬 ゆかり", "ちょっと緊張しちゃって…", 2, 0, 0, 0, 0, 1034, "ちょ\nちょっと一杯飲んできます…！", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("氷川 鏡華", "知らない人とは話しちゃいけないので", 2, 0, 0, 0, 0, 1036, "これ以上お話しすることは…\nないです！", 0, "氷川鏡華…です", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("柏崎 栞", "……あ、アラーム。", 2, 0, 0, 0, 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "柏崎…栞です。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("双葉 碧", "私、一人も友達がいなくて……", 2, 0, 0, 0, 0, 1040, "野に咲く花が、\n唯一の話相手です。", 0, "ふ、双葉碧です。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, 0, 0, 0, 1042, "そう思っています。", 0, "三角千歌です。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 2, 0, 0, 0, 0, 1043, "う、疑ってすまなかったな…", 0, "安芸真琴だ。", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 2, 0, 0, 0, 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "わらわこそは夜を総べる者！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("遠見 空花", "ぐふふふふ……はっ！", 2, 0, 0, 0, 0, 1045, "ｌク、クウカに何かご用ですか!?", 0, "そこで騎士は妖精を乱暴に……", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 0, 0, 0, 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("大神 美冬", "それでは早速クエストに…", 2, 0, 0, 0, 0, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "大神美冬よ！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("星野静流", "クエストもバトルも\n掃除も洗濯も", 2, 0, 0, 0, 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "星野静流だよ！", 1, 1.4, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("玉泉美咲", "見ての通りの\nセクシー美少女で", 2, 0, 0, 0, 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "アタシは玉泉美咲。", 1, 1.5, 1, 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES ("リマ", "？？？？", 2, 0, 0, 0, 0, 1052, "？？？？", 0, "？？？", 1, 1.4, 1, 1);
